function ProjectForm() {
    return (
        <form>
            <div>
                <input type="text" placeholder="Insira o nome do projeto" />
            </div>
            
            <select name="category_id">
                <option disabled>Selecione a categoria</option>
            </select>
        </form>
    )
}

export default ProjectForm
